import React, { Component } from 'react'
import { Container } from "@material-ui/core";
import storePic from '../../assets/img/store.jpg'

export default class Home extends Component {
    render() {
        return (
            <div id='home'>
               <Container >
                    <img src={storePic} alt="welcomePic" style={{maxWig}}/>
               </Container>
            </div>
        )
    }
}
